import React from 'react'
import { StyleSheet, Text, View } from 'react-native';

const Header = () => {
    return (
        <View>
            <div onClick={myFunction}>
                Hello
            </div>
        </View>
    )
}

export default Header


const myFunction = () => {
    console.log('Hello');
    return;
}
